import React, { Component } from 'react';

import FirstImpression from './components/first-impression.component';
import About from './components/about.component';
import Portfolio from './components/portfolio.component';

class Home extends Component {
  state = {};
  render() {
    return (
      <div
        id="spy-wrapper"
        data-spy="scroll"
        data-target="#mainNav"
        data-offset="0"
      >
        <FirstImpression />
        <Portfolio />
        <About />
      </div>
    );
  }
}

export default Home;
